import { FaTimes } from "react-icons/fa";
import { FaBeer } from "react-icons/fa";

const Task = ({ task }) => {
  return (
    <div className="task">
      <h3>
        {task.text}
        <FaTimes />
        <FaBeer />
      </h3>
    </div>
  );
};

export default Task;
